import React from "react"
import './App.css';

let state=[
  "Milk",
  "Wather",
  "Bread",
  "Chese",
  "Cerial"
]
let list= state.map(
    (element)=>{
  <div>{element}</div>
}
)
function App() {
  return (
    <div className="App">
      {list}
    </div>
  );
}

export default App;
